import Container from 'react-dom';

function Destaques () {
    return (
        <Container>
            <div>
                <img src='./public/images/photo.png' alt='Foto de Destaque'></img>
                <h3> Título da Notícia</h3>
                <h4>Subtítulo da Notícia</h4>
            </div>
        </Container>
    );
}

export default Destaques;
